import React from 'react';
import { Card, Table, Button } from 'react-bootstrap';
import { useLocation } from 'react-router-dom';

const OrderConfirmationPage = () => {
  const location = useLocation();
  const { order, cartItemsSummary } = location.state || {};

  // Handle missing order or cartItemsSummary gracefully
  if (!order || !cartItemsSummary) {
    return <div className="container mt-5">Order details not available.</div>;
  }

  const renderAddressSection = () => {
    if (order.orderType === 'Pickup') {
      return (
        <div className="mb-4">
          <h5>Pickup Details</h5>
          <p className="mb-0"><strong>Order Type:</strong> Pickup</p>
          <p className="text-secondary">You will receive a text message when your order is ready for pickup.</p>
        </div>
      );
    }

    if (order.deliveryAddress) {
      return (
        <div className="mb-4">
          <h5>Delivery Address</h5>
          <p className="mb-0">{order.deliveryAddress.street}</p>
          <p className="mb-0">
            {order.deliveryAddress.city}, {order.deliveryAddress.state} {order.deliveryAddress.zip}
          </p>
        </div>
      );
    }

    return null;
  };

  return (
    <div className="container mt-5">
      <Card className="shadow-sm">
        <Card.Header className="bg-primary text-white">
          <h3 className="mb-0">Order Confirmation</h3>
        </Card.Header>
        <Card.Body>
          {/* Order Details */}
          <div className="mb-4">
            <h5>Order Details</h5>
            <p className="mb-0"><strong>Order ID:</strong> {order._id}</p>
            <p className="mb-0"><strong>Status:</strong> {order.status}</p>
            <p className="mb-0"><strong>Total Amount:</strong> ${order.total.toFixed(2)}</p>
            <p className="mb-0"><strong>Payment Method:</strong> {order.payment_method}</p>
          </div>

          {/* Contact Information */}
          <div className="mb-4">
            <h5>Contact Information</h5>
            <p className="mb-0">
              {order.contactInfo.firstName} {order.contactInfo.lastName}
            </p>
            <p className="mb-0">{order.contactInfo.email}</p>
            <p className="mb-0">{order.contactInfo.phone}</p>
          </div>

          {/* Render Address Section */}
          {renderAddressSection()}

          {/* Items Table */}
          <div>
            <h5>Order Summary</h5>
            <Table striped bordered hover responsive>
              <thead>
                <tr>
                  <th>Product Name</th>
                  <th>Quantity</th>
                  <th>Price</th>
                  <th>Total</th>
                </tr>
              </thead>
              <tbody>
                {cartItemsSummary.map((item, index) => (
                  <tr key={index}>
                    <td>{item.name}</td>
                    <td>{item.quantity}</td>
                    <td>${item.price.toFixed(2)}</td>
                    <td>${(item.price * item.quantity).toFixed(2)}</td>
                  </tr>
                ))}
              </tbody>
              <tfoot>
                <tr>
                  <td colSpan="3" className="text-end"><strong>Total:</strong></td>
                  <td><strong>${order.total.toFixed(2)}</strong></td>
                </tr>
              </tfoot>
            </Table>
          </div>

          {/* Continue Shopping Button */}
          <Button
            variant="primary"
            className="mt-4"
            onClick={() => window.location.href = '/'}
          >
            Continue Shopping
          </Button>
        </Card.Body>
      </Card>
    </div>
  );
};

export default OrderConfirmationPage;
